import authReducer from './authReducer';
import { reducer as formReducer} from 'redux-form';
import { combineReducers } from 'redux';
import bookReducer from './bookReducer';

export default combineReducers({
    auth: authReducer,
    form: formReducer,
    books: bookReducer
})
